import React, { useEffect } from 'react';

const PayPalButton = () => {
  useEffect(() => {
    const script = document.createElement("script");
    script.src = "https://www.paypal.com/sdk/js?client-id=BAA08Aliiaqe29PxD86s85Fso0_5ydIfde83nw-41JN8PBqcHUzlU9p_JtMPbwroys1oxd-Ku6qkHj9jpo&components=hosted-buttons&disable-funding=venmo&currency=USD";
    script.async = true;
    script.onload = () => {
      if (window.paypal) {
        window.paypal.HostedButtons({
          hostedButtonId: "SPLRLRZKJYKHC",
        }).render("#paypal-container-SPLRLRZKJYKHC");
      }
    };
    document.body.appendChild(script);
  }, []);

  return (
    <div className="fixed bottom-4 right-4 z-50">
      <div id="paypal-container-SPLRLRZKJYKHC" />
    </div>
  );
};

export default PayPalButton;
